      <h1 className='text-3xl font-bold text-center text-gray-300'>Signup</h1>
      <form action="">
        <div>
          <label className=' label p-2'>
            <span className='text-base label-text'>Full Name</span>
          </label>
        </div>
      </form>
    </div>
  );
}

export default Signup;
